  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";


function App() {
  return (
    <div className="App">
      <Accueil />
      <h1>Dashboard aide</h1>
      <Postuler />
    </div>
  );
}

export default App;
